Treasure hunters have sparked outrage by digging up a protected sand dune nature reserve after influencers buried €1,000 (£850) and told followers to find it in Gran Canaria.&nbsp;
The money was buried at the Maspalomas Dunes in the San Bartolomé de Tirajana municipality in the south of the island.
A group of influencers had posted a video that said: ‘Let’s go for the €1,000!’&nbsp;
Excited crowds then gathered to look for a briefcase containing the money, buried to create publicity for a concert.

